import React, { Component } from "react";
import { AppBar, Toolbar, IconButton, InputBase, Tooltip } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu'
import SearchIcon from '@material-ui/icons/Search'
class DashboardComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {
            open: false,
            searchNote: ""

        }
        this.handleAppbar = this.handleAppbar.bind(this);
        this.handleSearchBar = this.handleSearchBar.bind(this);
    }
    handleToggle = () => {
        this.props.slideCards();
        this.setState({ open: !this.state.open });
    }

    handleRefresh=(evt)=> {
        evt.preventDefault();
        window.location.reload();
    }

    handleAppbar=()=> {
        this.props.notePropsToApp();
    }

    handleSearchBar=(evt) =>{
        this.setState({ searchNote: evt.target.value });
        this.props.getSearchedNotes(evt.target.value)
    }

    searchLabels = (value) => {
        this.props.searchLabels(value)
    }

    render() {
        return (
            // <MuiThemeProvider theme={theme}>
            <AppBar position="fixed" id="appbar" color="inherit">
                <Toolbar>
                    <div id="appBarMenuAndTitle">
                        <div>
                            <IconButton color="inherit" aria-label="Open drawer" >
                                <Tooltip title="Menu">
                                    <MenuIcon id="menu" onClick={this.handleToggle} />
                                </Tooltip>
                            </IconButton>
                        </div>
                        <div id="keepImage">
                            {/* <img src={require('/home/admin1/Jyotsana/fundoo_frontend-master/src/assets/images/keep_48dp (1).png')} alt="keep icon" /> */}
                        </div>
                        <span className="title"><b>fundooNotes</b></span>
                    </div>

                    <div id="appBarIcons">
                        <div id="searchBar">
                            <IconButton color="inherit" aria-label="Open drawer" style={{ marginLeft: "8px" }} >
                                <Tooltip title="Search">
                                    <SearchIcon style={{ color: "gray" }} />
                                </Tooltip>
                            </IconButton>

                            <InputBase
                                id="searchInputBase"
                                placeholder="Search......................."
                                value={this.state.searchNote}
                                onChange={this.handleSearchBar}
                            />
                        </div>
                        <div>
                            <IconButton>
                                <Tooltip title="Refresh" onClick={this.handleRefresh.bind(this)}>
                                    <img src={require('')} alt="refresh icon" />
                                </Tooltip>
                            </IconButton>
                        </div>
                        {/* <CardsView appPropstoCardsView={this.handleAppbar} /> */}
                    </div>
                </Toolbar>
                {/* <DrawerMenu
                    appBarProps={this.state.open}
                    handleNavigation={this.props.handleNavigation}
                    searchLabels={(value) => this.searchLabels(value)}
                    makeLabelFalse={this.props.makeLabelFalse} /> */}
            </AppBar>
            // </MuiThemeProvider>
        )
    }
}
export default DashboardComponent;
